    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Readex Pro', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
            background-color: #ffffff;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: flex-start;
            padding: 40px 20px;
        }

        .logo {
            margin-bottom: 80px;
        }

        .logo svg {
            height: 48px;
            width: auto;
        }

        .location-marker {
            margin-bottom: 40px;
            position: relative;
        }

        .location-bg {
            width: 88px;
            height: 88px;
            background-color: #F7F7F7;
            border-radius: 48px;
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            z-index: 0;
        }

        .location-marker svg {
            position: relative;
            z-index: 1;
        }

        h1 {
            font-family: 'Readex Pro', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
            font-weight: 450;
            font-size: 28px;
            line-height: 36px;
            letter-spacing: 0%;
            text-align: center;
            color: #000000;
            margin-bottom: 30px;
        }

        .description {
            font-family: 'Readex Pro', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
            font-weight: 450;
            font-size: 16px;
            line-height: 24px;
            letter-spacing: 0.25px;
            text-align: center;
            color: #334155;
            margin-bottom: 20px;
        }

        .contact-line {
            font-family: 'Readex Pro', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
            font-weight: 450;
            font-size: 16px;
            line-height: 24px;
            letter-spacing: 0.25px;
            text-align: center;
            color: #334155;
            max-width: 750px;
        }

        .email-link {
            color: #E6413E;
            text-decoration: none;
        }

        .email-link:hover {
            text-decoration: underline;
        }

        .highlight {
            color: #E6413E;
        }
    </style>
